import React, { useState } from "react";
import "../../styles/App.css";
import { Link, NavLink } from "react-router-dom";

function Header() {
  const [isOpen, setIsOpen] = useState(false);

  const handleMenuClick = () => {
    setIsOpen((prevState) => !prevState);
  };

  return (
    <header className="hdr d-flex justify-content-between align-items-center">
      <div
        type="button"
        className="logo"
        onClick={() => (window.location.href = "/")}
      >
        TERRACANVAS
      </div>
      <div
        className={`hamburger-menu ${isOpen ? "rotate" : ""}`}
        onClick={() => handleMenuClick()}
      >
        â˜°
      </div>
      {isOpen && (
        <div className="mobile-nav active">
          <NavLink to="/" exact activeClassName="active-link">Home</NavLink>
          <NavLink to="/map" activeClassName="active-link">Map</NavLink>
          <NavLink to="/community" activeClassName="active-link">Community</NavLink>
          <NavLink to="/termsconditions" activeClassName="active-link">Terms and Conditions</NavLink>
          <NavLink to="/privacypolicy" activeClassName="active-link">Privacy Policy</NavLink>
          <NavLink to="/contact" activeClassName="active-link">Contact</NavLink>
          <div className="auth-buttons">
            <NavLink to="/signin" activeClassName="active-link">Sign In</NavLink>
            <NavLink to="/signup" activeClassName="active-link">Sign Up</NavLink>
          </div>
        </div>
      )}
      <nav className="navbar d-flex justify-content-between">
        <NavLink to="/" activeClassName="active-link">HOME</NavLink>
        <NavLink to="/map" activeClassName="active-link">MAP</NavLink>
        <NavLink to="/community" activeClassName="active-link">COMMUNITY</NavLink>
      </nav>
      <div className="user-section d-flex align-items-center">
        <button>
          <Link to="/signin">Sign In</Link>
        </button>
        <button>
          <Link to="/signup">Sign Up</Link>
        </button>
      </div>
    </header>
  );
}

export default Header;
